import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import {faEnvelope} from '@fortawesome/free-solid-svg-icons';
import {faGithub} from '@fortawesome/fontawesome-svg-core';
import {faGooglePlay} from '@fortawesome/fontawesome-svg-core';
import Helmet from "react-helmet";
import React from 'react';
import './Resources.css';
import Navbar from "../../components/Navbar";

const Resources = () => {
    return (
        <div className="resources">
            <Helmet bodyAttributes={{style: 'background-color : var(--color-blue)'}}/>
            <Navbar></Navbar>
            <div className="resources-body">
                <h2>Resources</h2>
                <div className="grid-container-resources">
                    <div className="grid-child-resources"><button><FontAwesomeIcon icon={faEnvelope} className="dropbtn"/></button></div>
                    <div className="grid-child-resources"><button><FontAwesomeIcon icon={faGithub} className="dropbtn"/></button></div>
                    <div className="grid-child-resources"><button><FontAwesomeIcon icon={faGooglePlay} className="dropbtn"/></button></div>
                    <div className="grid-child-resources"></div>
                    <div className="grid-child-resrouces"></div>
                    <div className="grid-child-resrouces"></div>
                </div>
            </div>
        </div>   
    )
};

export default Resources;
